const BonusRandomBoxContainer = () => {

    return (
        <>
            <HrAppBar title='상여금 랜덤박스'/>
            <BonusRandomBoxComponent/>
            <BonusRandomBoxExplanation/>
        </>
    )
}

export default BonusRandomBoxContainer;
